"184321" : {
"id":184321,
"typeIconPath":"data/icons/BPMN/BPMN_Gateway.png",
"data" : [
{
"lang":"nl",
"name":"ZM nav VCM aanvragen?",
"type":"Gateway",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">KBG 4-8-2020&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Verdana;\">VCM&nbsp;<p style=\"margin-top: 3pt;\">- Middels het &quot;bericht VCM&quot; geeft OM bij de GGZ-instelling aan dat een verzoekschrift voor voortzetting van de crisismaatregel is ingediend bij de rechter. Dit bericht bevat een referentienummer voor het verzoekschrift van de OvJ De GGZ instelling moet dan (wanneer van toepassing) binnen 3 weken een aanvraag van de ZM in gang zetten (beoordeling doen / bevindingen GD opstellen). Het relateert ook aan art 7:5a, waarbij de GD langer dan de standaard 3 dagen zorg mag leveren onder een lopende Crisismaatregel als er een VCM is aangevraagd door de OvJ.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">- Vervolgens moet de GGZ-instelling het bericht &quot;Bevindingen GD&quot; met indicator &quot;ZM volgend op VCM&quot; naar het OM verzenden voor de aanvraag van de ZM. Het OMZIS-ID uit het daaraan vooraf gaande &quot;bericht VCM&quot; moet dan ook in het bericht &quot;Bevindingen GD&quot; worden opgenomen. Hierdoor weet het OM, als ontvanger, aan welke VCM de aanvraag ZM is gekoppeld.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Calibri;\"></span><span style=\" font-size: 11pt; font-family: Calibri;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 11pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"verwijzingen":{"type":"collection","value":[{"type":"link","value":{"title":"Artikel 7:5 Wet verplichte geestelijke gezondheidszorg","location":"https://wetten.overheid.nl/jci1.3:c:BWBR0040635&hoofdstuk=7&paragraaf=3&artikel=7:5&z=2020-01-01&g=2020-01-01"}},{"type":"link","value":{"title":"Verslag KBG iWvggz 20200804","location":"https://www.istandaarden.nl/ibieb/verslag-kbg-iwvggz-20200804"}}]}}}}]
}
]
}
