"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De berichtklasse Bijlage bevat naast het Bestand zelf ook de gestructureerde documentgegevens van dat bestand. De gegevens in het Bestand moeten overeenkomen met de gestructureerde documentgegevens: &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;Naam moet overeenkomen met de naam van het Bestand.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;Soort moet verplicht worden gevuld met waarde uit de vastgestelde gelimiteerde codelijst met documentsoorten. Het bestand zal geinterpreteerd worden als een document van dit soort.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;Formaat moet verplicht worden gevuld met het documentformaat van het Bestand. Het bestand zal gelezen worden als een bestand van het hier gekozen type.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;Versie moet altijd verplicht worden gevuld met de huidige versie van het Bestand. Indien een nieuwe versie aangeleverd wordt van dit Soort document, dient een hoger versienummer meegegeven te worden dan bij de eerdere aanlevering.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG101","id":26904,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG103","id":26973,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG105","id":27916,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG107","id":27919,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV603"}}}]
