"name":"IV602: Hoe moet AanvraagNummer gevuld worden in een AanwijzingGD?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij een aanwijzing van de geneesheer-directeur zijn twee situaties mogelijk:&nbsp;<p style=\"margin-top: 3pt;\">- De aanwijzing vindt plaats op basis van een Aanvraag zorgmachtiging die ontvangen is door het Openbaar Ministerie. In dit geval wordt het AanvraagNummer uit het originele bericht Aanvraag zorgmachtiging overgenomen.&nbsp;<p style=\"margin-top: 3pt;\">- De aanwijzing vindt plaats op basis van het ambtshalve starten van de voorbereiding van de zorgmachtiging door de Officier van Justitie. In dit geval wordt een nieuw UUID (versie 4) gevuld in het AanvraagNummer&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG103","id":26973,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV602"}}}]
