"178499" : {
"id":178499,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV028: Hoe wordt een retourbericht opgesteld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een retourbericht wordt gestuurd om de zender te informeren over de beoordeling (technisch/inhoudelijk) van het heenbericht. Voor ieder heenbericht wordt slechts 1 retourbericht gestuurd (1-op-1). De ontvanger stuurt altijd een retourbericht naar de verzender. </span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Deze invulinstructie heeft betrekking op alle retourberichten.&nbsp;<p style=\"margin-top: 3pt;\">Een retourbericht wordt als volgt opgebouwd: &nbsp;<p style=\"margin-top: 3pt;\">Een retourbericht bevat altijd een Header. &nbsp;<p style=\"margin-top: 3pt;\">* In de header wordt de BerichtCode gevuld met de berichtcode van het betreffende retourbericht.&nbsp;<p style=\"margin-top: 3pt;\">* Overige elementen, inclusief Afzender en Ontvanger, worden ongewijzigd overgenomen van de header van het heenbericht.&nbsp;<p style=\"margin-top: 3pt;\">* De header wordt aangevuld met identificerende gegevens van het retourbericht (IdentificatieRetour en DagtekeningRetour) en kan worden aangevuld met het versienummer van de XSLT's die gebruikt zijn om het bericht te controleren.&nbsp;<p style=\"margin-top: 3pt;\">Wat na de header volgt is afhankelijk van de situatie en geconstateerde fouten: &nbsp;<p style=\"margin-top: 3pt;\">* Zijn er geen fouten geconstateerd dan wordt alleen de Header zonder overige berichtklassen of retourcodes gestuurd.&nbsp;<p style=\"margin-top: 3pt;\">* Als er in de header of in de overige berichtklassen van het heenbericht fouten worden geconstateerd op basis van de XSLT controles, dan wordt de header aangevuld met retourcode 0001 (Bericht is technisch onjuist), of met een specifieke code zoals 9600. Overige berichtklassen worden niet meegezonden.&nbsp;<p style=\"margin-top: 3pt;\">* Als er in &#233;&#233;n van de berichtklassen fouten zijn geconstateerd op een van de regels die niet via XSD of XSLT gecontroleerd kunnen worden (niveau 3, zie IV032), dan worden altijd alle onder- en bovenliggende berichtklassen (van de klasse met fouten) ongewijzigd overgenomen in het retourbericht. Bij iedere berichtklasse wordt telkens met een retourcode aangegeven wat de status is:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;* Geen fouten geconstateerd in deze berichtklasse: retourcode 0200 &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;* Deze berichtklasse is niet gecontroleerd: retourcode 0233 &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;* Er is een fout geconstateerd in deze berichtklasse: betreffende retourcode &nbsp;<p style=\"margin-top: 3pt;\">Indien de ontvanger geen retourbericht kan maken, bijvoorbeeld omdat het bestand onleesbaar is, neemt de ontvanger buiten het berichtenverkeer om contact op met de verzender van het heenbericht. &nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG Retour","id":27869,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV028"}}}]
}
]
}
