"178554" : {
"id":178554,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV606: Hoe moet BetrokkeneAdres gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij een betrokkene wordt in BetrokkeneAdres het BRP-adres van de betrokkene opgenomen. Wanneer het verblijfadres van de betrokkene afwijkt van het BRP-adres, wordt een tweede BetrokkeneAdres opgenomen met daarin het verblijfadres. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het bericht Persoonsgegevens betrokkene (WVG111) vormt hierop een uitzondering; hierin wordt altijd maar &#233;&#233;n BetrokkeneAdres opgenomen. Dit is altijd het adres waar de betrokkene verblijft; dit is ofwel het BRP-adres ofwel het verblijfadres van de betrokkene.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien het verblijfadres van de betrokkene bij een organisatie is, wordt de naam van de organisatie ook opgenomen, en kunnen ook contactgegevens van de organisatie opgenomen worden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG109","id":66939,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG101","id":26904,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG103","id":26973,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG111","id":66118,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG115","id":27743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG105","id":27916,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WVG107","id":27919,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV606"}}}]
}
]
}
,
