"178741" : {
"id":178741,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV600: Hoe kan het bericht Bevindingen GD gebruikt worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het bericht Bevindingen GD kan zowel gebruikt worden voor een reguliere aanvraag van een zorgmachtiging, als voor een aanvraag in vervolg op een verlengde crisismaatregel.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Reguliere aanvraag (Aanleiding heeft de waarde 01):&nbsp;<p style=\"margin-top: 3pt;\">Het bericht Bevindingen GD wordt verstuurd in reactie op een bericht Aanwijzing GD. Gebruik het ZmAanvraagNummer uit dat bericht Aanwijzing GD&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Aanvraag na een verlengde crisismaatregel (Aanleiding heeft de waarde 02):&nbsp;<p style=\"margin-top: 3pt;\">Het bericht Bevindingen GD wordt verstuurd als eerste stap in de aanvraag van een zorgmachtiging. Gebruik VoortgezetteCmAanvraagNummer uit het bericht Vcm als waarde.&nbsp;<p style=\"margin-top: 3pt;\">In dit geval worden de Bevindingen opgesteld naar aanleiding van een ontvangen bericht Vcm.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG107","id":27919,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV600"}}}]
}
]
}
,
"178736" : {
"id":178736,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV032: Welke retourcode moet gevuld worden in het retourbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke retourcode gevuld moet worden, wordt bepaald door controle op basis waarvan het bericht wordt afgekeurd. De retourcode wordt meegegeven bij de berichtklasse waarop de controle van toepassing is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Technische regels, condities en constraints die niet op basis van een XSD &#243;f XSLT validatie gecontroleerd kunnen worden, hebben een eigen retourcode. Overige regels gebruiken retourcode 0001 (Bericht is technisch onjuist). Daarnaast zijn nog een aantal algemene retourcodes beschikbaar.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een ontvangen bericht wordt op drie niveaus gecontroleerd.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Niveau 1:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op leesbaarheid en gevalideerd tegen het XSD.&nbsp;<p style=\"margin-top: 3pt;\">Indien het bericht niet leesbaar is, neemt de ontvanger buiten het berichtenverkeer om contact op met de verzender van het heenbericht. Er wordt geen retourbericht verzonden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien het bericht niet valideert tegen het XSD wordt, indien mogelijk, een retourbericht verzonden waarin het bericht volledig wordt afgekeurd. Dat wil zeggen dat alleen de Header wordt verzonden met retourcode 0001 (Bericht is technisch onjuist). &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer het heenbericht niet valideert tegen het XSD kan het ook voorkomen dat het niet mogelijk is om een valide retourbericht op te stellen. In dat geval neemt de ontvanger buiten het berichtenverkeer om contact op met de verzender van het heenbericht en wordt er geen retourbericht verzonden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau</b> <b>2:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd tegen alle regels (technische regels, condities en constraints) die binnen het bericht zelf te controleren zijn. Voor deze regels zijn XSLT's beschikbaar die gebruikt kunnen worden om de controles uit te voeren. &nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd bevat het retourbericht alleen de Header met retourcode 0001 (Bericht is technisch onjuist). Wanneer de ter beschikking gestelde XSLT's gebruikt zijn, wordt bovendien het versienummer van de XSLT's meegegeven.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 3:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op alle overige regels die niet binnen het bestand zelf gecontroleerd kunnen worden. Dit betekent dat gecontroleerd wordt op:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Systeemdatum om te bepalen of de dagtekening niet in de toekomst ligt;<b></b></li><li>Alle berichtov<span style=\" font-family: Arial;\">erstijgende technische regels;<b></b></span></li><li><span style=\" font-family: Arial;\">Codelijsten die wel onderdeel zijn van de standaard, maar niet als enumeratie in de XSD's zijn opgenomen, zoals de gemeentelijke indeling van CBS.<b></ul></b>&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten zijn geconstateerd in &#233;&#233;n van de berichtklassen van het bericht, dan bevat het retourbericht de header en alle berichtklassen uit het heenbericht, voorzien van retourcode(s). De retourcode die hoort bij de regel op basis waarvan het bericht wordt afgekeurd, wordt ingevuld bij de berichtklasse waarin de fout is geconstateerd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">Let op: berichtklassen </span>waarvoor g&#233;&#233;n fouten zijn geconstateerd, worden niet opgenomen in het retourbericht (zie OP065).&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\">Let op: de verzender is verantwoordelijk voor het bewaken van de ontvangst van ofwel een retourbericht, ofwel een melding buiten het berichtenverkeer om (in geval een fout op niveau 1 is vastgesteld).&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG Retour","id":27869,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV032"}}}]
}
]
}
