"data" : [
{
"lang":"nl",
"name":"IV605: Hoe moet de header worden gevuld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij het berichttype wordt de code van het berichttype gevuld, zoals opgenomen in de daarvoor bedoelde codelijst. Bij een heenbericht wordt hiervoor en code eindigend op een oneven cijfer gebruikt, hij een retourbericht wordt de code van het bijpassende retourbericht (eindigend op een even cijfer) gebruikt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij Afzender wordt de identificerende code gevuld van de zender van het bericht, conform de gekoppelde constraint die aangeeft aan wat het type van de zender is.&nbsp;<p style=\"margin-top: 3pt;\">Bij Ontvanger wordt de identificerende code gevuld van de ontvanger van het bericht, conform de gekoppelde constraint die aangeeft wat het type van de ontvanger is.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WVG101","id":26904,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV605"}}}]
}
]
